double RidgeModel_LABRAHAM::predict(const std::vector<double>& features_scaled) {
    if (features_scaled.size() != n_features) {
        return 0.0;  // Error: feature count mismatch
    }
    
    auto coeffs = get_coefficients();
    double prediction = intercept;
    
    for (size_t i = 0; i < features_scaled.size(); ++i) {
        prediction += coeffs[i] * features_scaled[i];
    }
    
    return prediction;
}

double RidgeModel_LABRAHAM::predict_unscaled(const std::vector<double>& features) {
    if (features.size() != n_features) {
        return 0.0;  // Error: feature count mismatch
    }
    
    // Scale features
    auto mean = get_mean();
    auto scale = get_scale();
    std::vector<double> features_scaled(n_features);
    
    for (size_t i = 0; i < features.size(); ++i) {
        features_scaled[i] = (features[i] - mean[i]) / scale[i];
    }
    
    return predict(features_scaled);
}

